import React from 'react';

interface State {
  input: any;
}

class Form extends React.Component<State> {
  public state: State = {
    input: '',
  };

  public render() {
    return (
      <form>
        <input type="text"/>
        <button>登録</button>
      </form>
    );
  }
}

export default Form;
